dataset. Let us convert them to NAs","metadata":{}},{"cell_type":"code","source":"train[62,12] <- NA\ntrain[830,12] <- NA","metadata":{"execution":{"iopub.status.busy":"2022-02-06T16:31:01.586122Z","iopub.execute_input":"2022-02-06T16:31:01.588052Z","iopub.status.idle":"2022-02-06T16:31:01.603172Z"},"trusted":true},"execution_count":54,"outputs":[]},{"cell_type":"markdown","source":"I'd love to explore the Cabin column to see if the people with recorded Cabins survived or not. This will be strictly EDA and we will not use it for our model","metadata":{}},{"cell_type":"code","source":"train <- train %>%\n  mutate(Cabin = ifelse(is.na(train$Cabin) == \"TRUE\", \"Not Recorded\", \"Recorded\"))","metadata":{"execution":{"iopub.status.busy":"2022-02-06T16:31:01.605774Z","iopub.execute_input":"2022-02-06T16:31:01.607344Z","iopub.status.idle":"2022-02-06T16:31:01.622224Z"},"trusted":true},"execution_count":55,"outputs":[]},{"cell_type":"markdown","source":"There are so many ways to deal with missing variables. Well, let us omit the rows with missing variables","metadata":{}},{"cell_type":"code","source":"train <- na.omit(train)","metadata":{"execution":{"iopub.status.busy":"2022-02-06T16:31:01.624653Z","iopub.execute_input":"2022-02-06T16:31:01.626229Z","iopub.status.idle":"2022-02-06T16:31:01.638460Z"},"trusted":true},"execution_count":56,"outputs":[]},{"cell_type":"markdown","source":"Finally, it is going to be a classification model, so let us convert necessary columns to factors","metadata":{}},{"cell_type":"code","source":"train <- train %>%\n  mutate(across(c(Survived, Pclass, Sex, Cabin, Embarked), as.factor))","metadata":{"execution":{"iopub.status.busy":"2022-02-06T16:31:01.640978Z","iopub.execute_input":"2022-02-06T16:31:01.642572Z","iopub.status.idle":"2022-02-06T16:31:01.661739Z"},"trusted":true},"execution_count":57,"outputs":[]},{"cell_type":"markdown","source":"Now it is time to wrangle the test dataset. Note that we will not be using this dataset because my